import styled from "styled-components";

const Container = styled.div``;

const Register = () => {
  return (
    <Container>
      <Wrapper>
        <Title>CREATE AN ACCOUNT</Title>
        <Form>
          <Input placehold="NAME" />
          <Input placehold="LAST NAME" />
          <Input placehold="USERNAME" />
          <Input placehold="EMAIL" />
          <Input placehold="PASSWORD " />
          <Input placehold="CONFIRM PASSWORD" />
        </Form>
      </Wrapper>
    </Container>
  );
};

export default Register;
